import React from 'react';
import './Button.css';
import PropTypes from 'prop-types';

function Button({ text }) {
  return (
    <button className="Button" type="submit">
      {text}
    </button>
  );
}

Button.propTypes = {
  text: PropTypes.string.isRequired,
};

export default Button;
